def solve():
    field = [input() for _ in range(10)]

    def check_win(player):
        directions = [(1, 0), (0, 1), (1, 1), (1, -1)]
        for i in range(10):
            for j in range(10):
                if field[i][j] == player:
                    for di, dj in directions:
                        count = 1
                        for k in range(1, 5):
                            ni, nj = i + k * di, j + k * dj
                            if 0 <= ni < 10 and 0 <= nj < 10 and field[ni][nj] == player:
                                count += 1
                            else:
                                break
                        if count >= 5:
                            return True
        return False

    counts = defaultdict(int)
    for row in field:
        for cell in row:
            counts[cell] += 1

    if counts['X'] == counts['O']:
        empty_cells = [(i, j) for i in range(10) for j in range(10) if field[i][j] == '.']
        for i, j in empty_cells:
            field[i] = field[i][:j] + 'X' + field[i][j+1:]
            if check_win('X'):
                return 'YES'
            field[i] = field[i][:j] + '.' + field[i][j+1:]

    return 'NO'

