from itertools import product

def solve(n, k):
    if k > n*n:
        return -1

    grid = [[0]*n for _ in range(n)]

    for i, j in product(range(n), repeat=2):
        if k == 0:
            break
        if i == j:
            grid[i][j] = 1
            k -= 1
        elif i < j:
            if k >= 2:
                grid[i][j] = grid[j][i] = 1
                k -= 2

    if k > 0:
        return -1

    return '\n'.join([' '.join(map(str, row)) for row in grid])

