from itertools import product

def solve():
    n = int(input())
    s = input().strip()

    def is_substring(t, s):
        m, n = len(t), len(s)
        for i in range(m - n + 1):
            if t[i:i+n] == s:
                return True
        return False

    def get_shifted_strings(s):
        string_len = len(s)
        shifted_strings = set()

        for shift in range(string_len):
            shifted_string = s[shift:] + s[:shift]
            shifted_strings.add(shifted_string)

        return shifted_strings

    cyclical_strings = product('01', repeat=n)
    count = 0

    for t in cyclical_strings:
        t_str = ''.join(t)
        shifted_t_strings = get_shifted_strings(t_str)

        for shifted_t in shifted_t_strings:
            if is_substring(shifted_t, s):
                count += 1
                break

    print(count)

solve()

