import math

def solve(m):
    MOD = 10**9 + 7

    def mod_inverse(a, m):
        m0, x0, x1 = m, 0, 1
        while a > 1:
            q = a // m
            m, a = a % m, m
            x0, x1 = x1 - q * x0, x0
        return x1 + m0 if x1 < 0 else x1

    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    ans = 0
    for i in range(1, m + 1):
        ans += mod_inverse(i, m)
        ans %= MOD

    return (ans * mod_inverse(m, MOD)) % MOD

