def solve():
    n, k = map(int, input().split())
    paths = {}

    def f(x):
        if x % 2 == 0:
            return x // 2
        else:
            return x - 1

    def path(val):
        if val in paths:
            return paths[val]

        visited = set()
        current = val
        while current != 1 and current not in visited:
            visited.add(current)
            current = f(current)

        if current == 1:
            visited.add(1)

        for num in visited:
            paths[num] = visited.copy()

        return visited

    occurrences = {i: 0 for i in range(1, n+1)}
    for x in range(1, n+1):
        for num in path(x):
