from typing import List

def solve(n: int, k: int) -> int:

    def f(x):
        return x // 2 if x % 2 == 0 else x - 1

    def path(x):
        p = [x]
        while x != 1:
            x = f(x)
            p.append(x)
        return p

    occurances = {}

    for i in range(1, n + 1):
        for num in path(i):
            if num in occurances:
                occurances[num].add(i)
            else:
                occurances[num] = {i}

    max_val = max(num for num, paths in occurances.items() if len(paths) >= k)

    return max_val

