        A, B, C = map(int, input().split())
        if A not in X:
            X[A] = []
        X[A].append((C, B))
        if B not in X:
            X[B] = []
        X[B].append((C, A))

    for _ in range(M):
        D, E, F = map(int, input().split())
        if E not in Y:
            Y[E] = []
        Y[E].append((F, D))
        if F not in Y:
            Y[F] = []
        Y[F].append((E, D))

    visited = set()
    infinite = False

    def dfs(x, y, xmin, xmax, ymin, ymax):
        nonlocal infinite
        if x < xmin or x > xmax or y < ymin or y > ymax:
            return
        if (x, y) in visited:
            return
        visited.add((x, y))

        if x not in X or y not in Y:
            infinite = True
            return

        for c, a in X[x]:
            if y >= a and y <= c:
                dfs(x, c, xmin, xmax, ymin, ymax)
        for e, d in Y[y]:
            if x >= d and x <= e:
                dfs(e, y, xmin, xmax, ymin, ymax)

