        prefix_sum += a[i]
        if prefix_sum * 2 == total_sum:
            possible = True
            break

    if not possible:
        for i in range(1, n):
            if (prefix_sum + a[i]) * 2 == total_sum or (prefix_sum - a[i-1]) * 2 == total_sum:
