def solve(n: int) -> int:
    MOD = 998244353
    def power(x, y, mod):
        res = 1
        while y > 0:
            if y % 2 == 1:
                res = (res * x) % mod
            x = (x * x) % mod
            y //= 2
        return res

    def choose(n, k, mod):
        if k > n: return 0
        if k == n or k == 0: return 1
        fact = [1] * (n + 1)
        for i in range(2, n + 1):
            fact[i] = (fact[i - 1] * i) % mod
        inv_fact = [1] * (n + 1)
        inv_fact[n] = power(fact[n], mod - 2, mod)
        for i in range(n - 1, 0, -1):
            inv_fact[i] = (inv_fact[i + 1] * (i + 1)) % mod
        return (fact[n] * inv_fact[k] * inv_fact[n - k]) % mod

    if n % 2 == 0:
        return (choose(n, n // 2, MOD) * power(n // 2 + 1, MOD - 2, MOD)) % MOD
    else:
        return 0

solve()

