def solve():
    import math

    mod = 998244353

    def inverse(x):
        return pow(x, mod - 2, mod)

    def add(a, b):
        return (a + b) % mod

    def sub(a, b):
        return (a - b + mod) % mod

    def mul(a, b):
        return (a * b) % mod

    n = int(input())
    lr = [list(map(int, input().split())) for _ in range(n)]

    dp = [0] * (n + 1)
    dp[0] = 1

    for i in range(n):
        for j in range(n, 0, -1):
            dp[j] = add(mul(sub(lr[i][1], lr[i][0] + 1), inverse(lr[i][1] - lr[i][0])), mul(dp[j - 1], mul(sub(lr[i][1], lr[i][0]), inverse(lr[i][1] - lr[i][0])))

    ans = sum(dp)
    for i in range(1, n + 1):
        ans = mul(ans, inverse(i))

    print(ans)


