                while base % i == 0:
                    count += 1
                    base //= i
                p = i
                c = 0
                while p <= n:
                    c += n // p
                    p *= i
                zeros = min(zeros, c // count)
            if base == 1:
                break
        return zeros

    result = trailing_zeros_in_factorial(n, b)
    print(result)

