def solve():
    m, a, b = map(int, input().split())
    if a > m:
        return m + 1
    if a == b:
        return a + 1
    if a < b:
        a, b = b, a
    g = [1]
    s = {1}
    M = 1
    while True:
        d = g[-1] + a
        if d > m:
            break
        if d in s:
            return m * (m + 1) // 2
        s.add(d)
        g.append(d)
        d += b - a
        s.add(d)
        g.append(d)
        M = d

    r = max(M + b, m) - m
    g2 = []
    for k in g:
        if k <= m:
            g2.append(k)
            if k + b <= m:
                g2.append(k + b)
    n = 1
    for i in range(len(g2) - 1):
        k, l = g2[i : i + 2]
        if k + 1 == l:
            continue
        n += (l - k) * (l - k - 1) // 2

    return m * (m + 1) // 2 - n * (r * (r - 1) // 2)

solve()

