from math import gcd

def solve(n: int) -> int:
    MOD = 10**9 + 7

    def factorial(num):
        if num == 0:
            return 1
        return (num * factorial(num - 1)) % MOD

    ans = 1
    for i in range(2, n + 1):
        ans = (ans * gcd(i, ans)) % MOD

    return factorial(n) // factorial(n - ans)

