    n, l, x, y = map(int, input().split())
    marks = list(map(int, input().split()))

    def can_measure(d):
        for i in range(n):
            for j in range(i + 1, n):
                if marks[j] - marks[i] == d:
                    return True
        return False

    def find_missing_mark(d):
        for i in range(n):
            if marks[i] + d in marks:
                return marks[i]
            if marks[i] - d in marks:
                return marks[i] - d
        return -1

    def add_mark(d):
        for i in range(n):
            if marks[i] + d not in marks and 0 <= marks[i] + d <= l:
                return marks[i] + d
            if marks[i] - d not in marks and 0 <= marks[i] - d <= l:
                return marks[i] - d
        return -1

    if can_measure(x) and can_measure(y):
        print(0)
    elif can_measure(x):
        mark = add_mark(y)
        if mark != -1:
            print(1)
            print(mark)
        else:
            print(0)
    elif can_measure(y):
        mark = add_mark(x)
        if mark != -1:
            print(1)
            print(mark)
        else:
            print(0)
    else:
        mark1 = find_missing_mark(x)
        mark2 = add_mark(y)
        if mark1 != -1 and mark2 != -1:
            print(1)
            print(mark2)
        else:
            print(2)
            print(mark1, mark2)

solve()

