def solve():
    modulo = 10**9 + 7

    n, m = map(int, input().split())

    if n == 1:
        print(pow(2, m, modulo))
    else:
        fact = [1] * (m+1)
        for i in range(2, m+1):
            fact[i] = (fact[i-1] * i) % modulo

        inv_fact = [1] * (m+1)
        inv_fact[m] = pow(fact[m], modulo-2, modulo)
        for i in range(m-1, 0, -1):
            inv_fact[i] = (inv_fact[i+1] * (i + 1)) % modulo

        def get_combinations(x, y):
            return (fact[x] * inv_fact[y] * inv_fact[x - y]) % modulo

        answer = 0
        for k in range(1, n+1):
            sign = 1 if k % 2 == 1 else -1
            cnt = n - k
            answer += sign * get_combinations(m, k) * get_combinations(m + cnt - 1, m - 1)

        print((answer * fact[n-1]) % modulo)

solve()

