def solve():
    N, M = map(int, input().split())
    weights = list(map(int, input().split()))
    parts = [list(map(int, input().split())) for _ in range(M)]

    sorted_weights = sorted(weights)

    max_allowed = [0] * (N + 1)
    for i in range(M):
        l, v = parts[i]
        for j in range(N):
            if l >= sorted_weights[j]:
                max_allowed[j + 1] = max(max_allowed[j + 1], min(v, sorted_weights[j + 1]))

    if max_allowed[N] == 0:
        print(-1)
        return

    lo, hi = max_allowed[N], float('inf')
    while lo < hi:
        mid = (lo + hi) // 2
        dp = [float('inf')] * (1 << N)
        dp[0] = 0

        for mask in range(1 << N):
            for i in range(N):
                if (mask & (1 << i)) == 0:
                    for j in range(N):
                        if (mask & (1 << j)) == 0:
                            dp[mask | (1 << i)] = min(dp[mask | (1 << i)], dp[mask] + abs(sorted_weights[i] - sorted_weights[j]) / mid)

        if dp[(1 << N) - 1] <= max_allowed[N]:
            hi = mid
        else:
            lo = mid + 1

    print(lo)

